import './App.css';
import React, { useEffect } from 'react';
import { useDispatch } from 'react-redux';
import Header from './components/Header';
import Router from './components/Router';
import axios from 'axios'
import 'bootstrap/dist/css/bootstrap.min.css';
import { retrieveUserToken } from './components/redux/UserActions';
import { retrieveAdminToken } from './components/redux/AdminActions';

axios.interceptors.request.use(
  config => {
    console.log("interceptors : ",sessionStorage.getItem('usersToken'))
    config.headers['Authorization'] = `Bearer ${sessionStorage.getItem('usersToken')} ${sessionStorage.getItem('adminsToken')}`;
        return config;
    },
    error => {
        return Promise.reject(error);
    }
);

function App() {
  const dispatch = useDispatch()
  useEffect(() => {
    dispatch(retrieveUserToken())
    dispatch(retrieveAdminToken())
  },[dispatch])

  return (
      <React.Fragment>
        <header>
          <Header/>
        </header>
        <main>
          <Router/>
        </main>
      </React.Fragment>
  );
}

export default App;
